import './App.css';
import Header from './components/header/Header';
import Menu from './components/menu/Menu';
import Chart from './components/charts/Charts'
import Charts from './components/charts/Charts';

function App() {
  return (
    <div>
      <Header />

      <div className='container-fluid'>
        <div className='row'>
          <Menu />
          <div className='test'>
            <Charts />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
